import React from "react";
import {ResponsiveBar} from "@nivo/bar";



const Testsgraph = ({label}) => {
const data = [
  {
    "country": label[0],
    "tests conducted": 135,
    "hot dogColor": "hsl(204, 70%, 50%)"
  },
  {
    "country": "AE",
    "burger": 116,
    "burgerColor": "hsl(352, 70%, 50%)",
  },
  {
    "country": "AF",
    "sandwich": 145,
    "sandwichColor": "hsl(48, 70%, 50%)"
  },
  {
    "country": "AG",
    "hot dog": 42,
    "hot dogColor": "hsl(90, 70%, 50%)",
    "burger": 72,
    "burgerColor": "hsl(240, 70%, 50%)",
    "sandwich": 12,
    "sandwichColor": "hsl(253, 70%, 50%)",
    "kebab": 6,
    "kebabColor": "hsl(325, 70%, 50%)",
    "fries": 41,
    "friesColor": "hsl(17, 70%, 50%)",
    "donut": 0,
    "donutColor": "hsl(315, 70%, 50%)"
  },
  {
    "country": "AI",
    "hot dog": 152,
    "hot dogColor": "hsl(28, 70%, 50%)",
    "burger": 75,
    "burgerColor": "hsl(14, 70%, 50%)",
    "sandwich": 140,
    "sandwichColor": "hsl(136, 70%, 50%)",
    "kebab": 177,
    "kebabColor": "hsl(2, 70%, 50%)",
    "fries": 93,
    "friesColor": "hsl(209, 70%, 50%)",
    "donut": 15,
    "donutColor": "hsl(345, 70%, 50%)"
  },
  {
    "country": "AL",
    "hot dog": 118,
    "hot dogColor": "hsl(237, 70%, 50%)",
    "burger": 157,
    "burgerColor": "hsl(158, 70%, 50%)",
    "sandwich": 111,
    "sandwichColor": "hsl(223, 70%, 50%)",
    "kebab": 63,
    "kebabColor": "hsl(213, 70%, 50%)",
    "fries": 61,
    "friesColor": "hsl(22, 70%, 50%)",
    "donut": 61,
    "donutColor": "hsl(336, 70%, 50%)"
  },
  {
    "country": "AM",
    "hot dog": 105,
    "hot dogColor": "hsl(195, 70%, 50%)",
    "burger": 5,
    "burgerColor": "hsl(78, 70%, 50%)",
    "sandwich": 167,
    "sandwichColor": "hsl(88, 70%, 50%)",
    "kebab": 67,
    "kebabColor": "hsl(338, 70%, 50%)",
    "fries": 101,
    "friesColor": "hsl(324, 70%, 50%)",
    "donut": 196,
    "donutColor": "hsl(230, 70%, 50%)"
  }
];
	return (
		<div style={{height: "500px", width: "100%"}}>
		<ResponsiveBar
        data={data}
        keys={[ 'hot dog', 'burger', 'sandwich', 'kebab', 'fries', 'donut' ]}
        indexBy="country"
        margin={{ top: 50, right: 130, bottom: 50, left: 60 }}
        padding={0.3}
        layout="horizontal"
        valueScale={{ type: 'linear' }}
        indexScale={{ type: 'band', round: true }}
        theme={{textColor: "#41c7c7"}}
        colors={{ scheme: 'nivo' }}
        defs={[
            {
                id: 'dots',
                type: 'patternDots',
                background: 'inherit',
                color: '#38bcb2',
                size: 4,
                padding: 1,
                stagger: true
            },
            {
                id: 'lines',
                type: 'patternLines',
                background: 'inherit',
                color: '#eed312',
                rotation: -45,
                lineWidth: 6,
                spacing: 10
            }
        ]}
        fill={[
            {
                match: {
                    id: 'fries'
                },
                id: 'dots'
            },
            {
                match: {
                    id: 'sandwich'
                },
                id: 'lines'
            }
        ]}
        borderColor={{ from: 'color', modifiers: [ [ 'darker', 1.6 ] ] }}
        axisTop={null}
        axisRight={null}
        axisBottom={{
            tickSize: 5,
            tickPadding: 5,
            tickRotation: 0,
            legend: 'country',
            legendPosition: 'middle',
            legendOffset: 32
        }}
        axisLeft={{
            tickSize: 5,
            tickPadding: 5,
            tickRotation: 0,
            legend: 'food',
            legendPosition: 'middle',
            legendOffset: -40
        }}
        enableGridY={false}
        labelSkipWidth={12}
        labelSkipHeight={12}
        labelTextColor={{ from: 'color', modifiers: [ [ 'darker', 1.6 ] ] }}
        animate={true}
        motionStiffness={90}
        motionDamping={15}
    />
		</div>
		)
}

export default Testsgraph;
